gl renderer: Make RoundedRect work in gles

Which can't return struct types containing arrays. So let's revert to
the previous version but still send the rect along as a vec4[3];

grabHelper: Add (promised-based) grabAsync()

Some GrabHelper uses are in the form:

    doPreGrabStuff();

    this._grabHelper.grab({
        onUngrab: () => {
            undoPreGrabStuff();
        },
    });

A promise-based variant allows to write this more cleanly as:

    doPreGrabStuff();

    await this._grabHelper.grabAsync();

    undoPreGrabStuff();

